      (8658, '核心測驗美食店8658', 1, 5, 10, '細火慢燉、香Q彈牙', '五月雪保留客家料理的精髓，但在口味上趨近清淡所以店內56餘道客家菜風味道地，又可口也不會太油又太鹹。店內的菜色很多元，兼具傳統與創新， 除了必嘗的外婆醬肉、白斬放山雞、醬筍炆鮮魚、和風鹹豬肉之外，想來點不同的還可以點選店家的私房菜，依四季調整的當季食材，每每總讓人驚豔。我們菜色上不僅求新求變，還要不失客家風味，而且還要好吃。所以師傅們就得花更多的工序與心思在菜色上，讓菜色更加美味。 「我們嚴選台灣各地上等的食材，將最好的料理奉獻給客人，讓客人下次繼續光顧，是我們的服務理念。」', '25.115176,121.515018', '0X11-0X9-XX5', '台北市北投區XX路XX巷XX樓', '從XX站走路10分鐘！！', '全年無休', '17:00~28:00', '可包廂、可預約', '2018-05-18 14:37:00', '2018-05-18 14:37:00'),
